import React, { Component } from 'react'
import CBCKids from '../../../assets/CBC_Kids_2017.png'
import DisneyJunior from '../../../assets/PngItem_835216.png'

class Terms extends Component{

  displayLogos(){

    switch(this.props.country){
      case 'Canada':
        return <div className="broadcasters">
        <img src={CBCKids}/>
        <img src={DisneyJunior}/>
        </div>
      case 'United States':
        return <div className="broadcasters">
          <img src={DisneyJunior} />
        </div>
      default:
        return  <div className="broadcasters">
          <img src={DisneyJunior} />
        </div>
    }
  }
  render(){
    return(
      <footer className="footer">
        <div className="h2-shadow">WhereTo</div>
        <h2>Where To Watch</h2>
        {this.displayLogos()}

        <div className="terms">
          <a href="">Terms and Conditions</a>
          <a href="">Privacy Policy</a>
        </div>
      </footer>
    )
  }
}
export default Terms
